BEGIN
    -- Simple Signal Assign...
    X <= (a AND NOT sel) OR (b AND sel);
    -- Cond. Signal Assign...
    Y <= A WHEN sel='0' ELSE
        B;
    -- Selected Signal Assignment
    Z <= a WHEN '0';
         B WHEN '1';
         '0' WHEN OTHERS;
END ARCHITECTURE logic;

