 /*Next_Permutation*/
 vector<vector<int>>nextpermutation(int n,vector<int>&v){
  ll size=1;
  for(int i=1;i<=n;i++){
    size*=i;
  }
  vector<vector<int>>ans(size);
  int counter=0;
  sort(v.begin(),v.end());
  do{
    for(int i=0;i<n;i++){
      ans[counter].push_back(v[i]);
    }
    counter++;
  }while(next_permutation(v.begin(),v.end()));
  return ans;
 }
