        std::cin >> point.x;
        cout << "Enter y:";
        std::cin >> point.y;
    }
 
    int pointInQuadrant(const Point point) {
        if (point.y > 0) {
            if (point.x > 0)return 1;
            else return 2;
        } else {
            if (point.x > 0)return 4;
            else return 3;
        }
    }
