public class Solution {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int test = sc.nextInt();
        sc.nextLine(); 

        int z = 1;
        while (test-- > 0) {
            Stack<Integer> stack = new Stack<>();
            Stack<Integer> maxi = new Stack<>();
            System.out.println("Case " + z + ": ");
            int q = sc.nextInt();
            sc.nextLine(); 
            while (q-- > 0) {
                String s = sc.nextLine();
                String type[] = s.split(" ");

                if (type[0].equals("A")) {
                    stack.push(Integer.parseInt(type[1]));
                    if (maxi.isEmpty()) {
                        maxi.push(Integer.parseInt(type[1]));
                    } else {
                        if (maxi.peek() > Integer.parseInt(type[1])) {
                            maxi.push(maxi.peek());
                        } else {
                            maxi.push(Integer.parseInt(type[1]));
                        }
                    }
                } else if (type[0].equals("R")) {
                    if(!stack.isEmpty()){
                        stack.pop();
                        maxi.pop();
                    }
                    
                } else {
                    if(maxi.isEmpty()){
                        System.out.println("Empty");
                    }
                    else{
                        System.out.println(maxi.peek());
                    }
                    
                }
            }
            z++;
        }
    }
